import axios from 'axios'
import React, { Component } from 'react'




class ProductList extends Component {

    constructor(props) {
        super(props)

        this.state = {

            Products : []

        }
    }        

     componentDidMount(){
        //   axios.get('/Products')
          fetch('/Products')
         .then(res => res.json())
         .then(res2 => {console.log(res2)
            this.setState({
                Products : res2
            })  
        })



    //     // this.setState({ ProductList: response.data.ProductList})

     }


    render() {

        const list = this.state.Products.map(item => {
            return <div>


                <p>{item.name}</p>
                <p>{item.brand}</p>
                <p>Bidding date {item.bidDate}</p>
                <p>{item.image1}</p>
              <img src={item.image1} alt="abcs" /> 

            </div>
        })

        return (

            <div>
                {list}

            </div>
        )
    }
}

export default ProductList
